  false,\n\t\"url\": null,\n\t\"notes\": \"The Strategic Investment Areas portrayed
  in this data set are based on the Strategic Investment Areas Overlay Analysis, which
  is part of the City of Austinu2019s Long-Range Capital Improvement Program Strategic
  Plan (LRCSP)*. Due to the limitations of the platform, the data is not displayed
  how it is meant to be viewed. Please see the dark red u201cAboutu201d tab for a
  thumbnail of how the map is ideally viewed and two attachments. One attachment is
  a description of the metadata and the other attachment provides instructions for
  how to view the data properly.rnThe Strategic Investment Areas map shows the geographic
  location of unfunded or long-term infrastructure needs identified in the FY 2016-17
  LRCSP and the degree to which those future investments could enable recommendations
  in multiple City of Austin initiatives, as identified in the LRCSP Strategic Areas
  map (see the CPO LRCSP Strategic Areas dataset on the Open Data Portal). The degree
  of overlap with multiple City initiatives is indicated by darker shades. The goal
  of the analysis is to identify strategic areas for collaboration and coordination
  of capital investment related to implementing Imagine Austin. The data is organized
  around Imagine Austin Priority Program topic areas: Compact and Connected, Nature
  and City, Creativity and Economy, Healthy and Affordable. The purpose of the LRCSP
  Strategic Investment Areas Overlay Analysis is to support the identification of:
  (a) Strategic investment in infrastructure that implements Imagine Austin, (b) Potential
  cost savings and other efficiencies and (c) Improved outcomes for our capital investments.
  NOTE: the areas are updated periodically to respond to changes in both infrastructure
  needs and City plans and policies, as reflected in City Council-approved initiatives.rn*The
  Long-Range CIP Strategic Plan is produced annually, and the Planning Commission
  uses the plan to make its annual recommendation to the City Manager about projects
  necessary or desirable to implement the comprehensive plan, per its role in the
  City Charter. Learn more about the plan or download it at Austintexas.gov/strategicplan.\",\n\t\"license_title\":
